IF(
    CONTAINS(LOWER({!Get_User.Profile.Name}), "administration"), "Administration", 
    IF(
        CONTAINS(LOWER({!Get_User.Profile.Name}), "laboratory"), "Laboratory",
        IF(
            CONTAINS(LOWER({!Get_User.Profile.Name}), "nursing"), "Nursing",
            IF(
                CONTAINS(LOWER({!Get_User.Profile.Name}), "doctors"), "Doctors",
                IF(
                    CONTAINS(LOWER({!Get_User.Profile.Name}), "administrator"), "Administrator",
                    "Other"
                )
            )
        )
    )
)
